import React from 'react';
import styles from './Header.module.css'; // Подключаем CSS модуль для стилей

const Header = () => {
  return (
    <div className={styles.headerContainer}>
      <div className={styles.contentContainer}>
        <div className={styles.location}>
          {/* Иконка местоположения (вставьте свою иконку) */}
          <img src="location_icon.png" alt="Location Icon" className={styles.icon} />
          <span>Ваш город: Москва</span>
        </div>
        <div className={styles.info}>&#9660; Информация &#9660;</div>
        <div className={styles.cooperation}>&#9660; Сотрудничество &#9660;</div>
      </div>
      <div className={styles.menuContainer}>
        <ul className={styles.menu}>
          <li>Доставка</li>
          <li>Оплата</li>
          <li>Гарантия</li>
          <li>Новости</li>
          <li>Журнал</li>
          <li>О магазине</li>
          <li>Контакты</li>
        </ul>
      </div>
    </div>
  );
};

export default Header;
